import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './styleFooter.css';

export default class Footer extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="footer" style={{ backgroundColor: 'white' }}>
        <div className="container-fluid">
          <div className="row text-center">
            {this.props.sectionR ? (
              <div
                className="col-md-7 div_footer_left"
                style={{
                  backgroundColor: 'white',
                  paddingLeft: 7,
                  paddingRight: 7
                }}>
                <button className="sinHover btn btn-link">
                  Copyright ©
                  <Link to="/#home" className=" text-dark">
                    {' '}
                    Starkclass
                  </Link>{' '}
                  2019
                </button>
              </div>
            ) : (
              <div
                className="col-12 div_footer_left"
                style={{
                  backgroundColor: 'white',
                  textAlign: 'center',
                  paddingLeft: 7,
                  paddingRight: 7
                }}>
                <button className="sinHover btn btn-link">
                  Copyright ©
                  <Link to="./#home" className=" text-dark">
                    {' '}
                    Starkclass
                  </Link>{' '}
                  2019
                </button>
              </div>
            )}
            {this.props.sectionR ? (
              <div
                className="col-md-5 div_footer_rigth my-auto"
                style={{ backgroundColor: 'white' }}>
                <div className="row">
                  <div
                    className="col-4 my-auto"
                    style={{ paddingLeft: 7, paddingRight: 7 }}>
                    <Link to="/preguntas" className="sinHover">
                      Preguntas frecuentes
                    </Link>
                  </div>
                  <div
                    className="col-4 my-auto"
                    style={{ paddingLeft: 7, paddingRight: 7 }}>
                    <Link to="/terminos" className="sinHover">
                      Términos
                    </Link>
                  </div>
                  <div
                    className="col-4 my-auto"
                    style={{ paddingLeft: 7, paddingRight: 7 }}>
                    <Link to="/politica" className="sinHover">
                      Políticas de privacidad
                    </Link>
                  </div>
                </div>
              </div>
            ) : null}
          </div>
        </div>
      </div>
    );
  }
}
